For the polynomial \(x^4 + 2x^3 + 0x^2 + 0x + 2 = 0\), Vieta's formulas tell us:
1. \(\alpha_1 + \alpha_2 + \alpha_3 + \alpha_4 = -2\)
2. \(\alpha_1\alpha_2 + \alpha_1\alpha_3 + \alpha_1\alpha_4 + \alpha_2\alpha_3 + \alpha_2\alpha_4 + \alpha_3\alpha_4 = 0\)
3. \(\alpha_1\alpha_2\alpha_3 + \alpha_1\alpha_2\alpha_4 + \alpha_1\alpha_3\alpha_4 + \alpha_2\alpha_3\alpha_4 = -0 = 0\)
4. \(\alpha_1\alpha_2\alpha_3\alpha_4 = 2\)

We need to find the values of \(\alpha_1\alpha_2 + \alpha_3\alpha_4\), \(\alpha_1\alpha_3 + \alpha_2\alpha_4\), and \(\alpha_1\alpha_4 + \alpha_2\alpha_3\). Let's denote these expressions by \(a\), \(b\), and \(c\) respectively. Then we have:
\[a + b + c = \alpha_1\alpha_2 + \alpha_3\alpha_4 + \alpha_1\alpha_3 + \alpha_2\alpha_4 + \alpha_1\alpha_4 + \alpha_2\alpha_3 = 0.\]

We also know from the polynomial that:
\[\alpha_1\alpha_2\alpha_3\alpha_4 = 2.\]

To find the values of \(a\), \(b\), and \(c\), we can use the identity:
\[(\alpha_1\alpha_2 + \alpha_3\alpha_4)(\alpha_1\alpha_3 + \alpha_2\alpha_4)(\alpha_1\alpha_4 + \alpha_2\alpha_3) = (\alpha_1\alpha_2\alpha_3\alpha_4)^2 + (\alpha_1\alpha_2 + \alpha_3\alpha_4)(\alpha_1\alpha_3 + \alpha_2\alpha_4)(\alpha_1\alpha_4 + \alpha_2\alpha_3) - (\alpha_1\alpha_2)^2(\alpha_3\alpha_4)^2 - (\alpha_1\alpha_3)^2(\alpha_2\alpha_4)^2 - (\alpha_1\alpha_4)^2(\alpha_2\alpha_3)^2.\]

